import React, { useEffect, useState } from 'react';
import {Grid, List, ListItem, ListItemIcon, Avatar, ListItemText } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import './Style.css';  
import { Link } from 'react-router-dom';
import logo from './assets/secura.png';
import Searchbar from './Searchbar';

const App = () => {
  const [userData, setUserData] = useState({ name: '', avatar: '' });
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);

  useEffect(() => {
    const handleResize = () => {
      setWindowWidth(window.innerWidth);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await fetch('https://jsonplaceholder.typicode.com/users/1');
        const data = await response.json();
        setUserData(data);
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };
    fetchUserData();
  }, []);

  return (
    <div className="app-container">
      {/* First Sidebar */}
      <div className="sidebar sidebar-light">
      <img src={logo} alt="Logo"/>
        <List>
          <ListItem>
            <ListItemIcon>
              <Home sx={{color:'white'}}/>
            </ListItemIcon>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <Inbox sx={{color:'white'}}/>
            </ListItemIcon>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <Mail sx={{color:'white'}}/>
            </ListItemIcon>
          </ListItem>
        </List>
      </div>

      {/* Second Sidebar (conditionally rendered based on screen width) */}
      {windowWidth > 600 && (
        <div className="sidebar sidebar-dark">
          <div className="user-info">
            <div>{userData.name}</div>
            <Avatar src={userData.avatar} alt="User Avatar" className="avatar" />
          </div>
          <List>
            <ListItem>
              <ListItemIcon>
                <LiveTv sx={{color:'white'}}/>
              </ListItemIcon>
              <ListItemText primary="Live" />
            </ListItem>
            <ListItem>
              <ListItemIcon>
                <ViewComfy sx={{color:'white'}}/>
              </ListItemIcon>
              <ListItemText primary="Layout" />
            </ListItem>
            <ListItem>
              <ListItemIcon>
                <Timeline sx={{color:'white'}}/>
              </ListItemIcon>
              <ListItemText primary="Sequence" />
            </ListItem>
            <ListItem>
              <ListItemIcon>
                <MoreHoriz sx={{color:'white'}}/>
              </ListItemIcon>
              <ListItemText primary="More" />
            </ListItem>
          </List>
        </div>
      )}

      <Grid item xs={6}>
        <Searchbar/>
      </Grid>
    </div>
  );
};

export default App;
